import React from 'react'
import Image from './Components/Images/out.jpg'

const RightDiv = () => {
    return (
        <div className='w-1/2 h-screen bg-cover bg-center'
        style={{
        backgroundImage: `url(${Image})`,}}>
            
            <p>Home</p>
        </div>
    );
};

  
export default function App() {
    return (
        <div>
            <RightDiv/>
        </div>
    )
}
